import '../node_modules/bootstrap/dist/css/bootstrap.min.css';

const App = () => {
  return (
    <>
    <div style={{display:"inline-block", float:"left"}}>
    
      <h1 className="text-xl-start">
      Keep Note</h1>
      </div>
     
    </>
  );
};
export default App;
